import React, { useEffect, useState } from 'react';
import axios from 'axios';

function PapusiFete() {
  const [fetes, setFetes] = useState([]);

  useEffect(() => {
    // Fetch items from the API endpoint
    axios.get('/api/fete')
      .then((response) => {
        setFetes(response.data);
      })
      .catch((error) => {
        console.error('Error fetching items:', error);
      });
  }, []);

  return (

    // <div >
    // {fetes.map((Fete) => (
    //     <div className='asezare' key={Fete._id}>
    //         <h2>{Fete.nume}</h2>
    //         <img clsssName = 'imgProduse'src={Fete.img} alt={Fete.nume} />
    //     </div>
    // ))}
    // </div>

    <div className='prodFete'>
        <h1>
          Fete
        </h1>
        {Array.isArray(fetes) && fetes.length > 0 ? (
          <ul>
            {fetes.map((Fete) => (
              <li key={Fete._id}>
                <h2>{Fete.nume}</h2>
                <img src={Fete.img} alt={Fete.nume} />
                {/* <p>{fruit.review}</p>
                <p>{fruit.score}</p> */}
              </li>
            ))}
          </ul>
        ) : (
          <p>Loading fruits...</p>
        )}
      </div>
  );
}

export default PapusiFete;
